import React, { useEffect, useState } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';


const Signup = () => {
    const navi=useNavigate()
    useEffect(() => {
        AOS.init({ duration: 1000 }); 
    }, []); 
    

    return (
        <div data-aos="flip-left">
            <div className='image d-flex vh-100 justify-content-center align-items-center'>
                <div className='llll bg-white rounded p-3'>

                    <h1 className='text-center'>NEW REGISTRATION</h1>
                    <br />

                    <form>
                        <div className="mb-3">
                            <label htmlFor="exampleInputEmail1" className="form-label">UserName</label>
                            <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"
                            value={name}
                            required
                            onChange={(e)=>setName(e.target.value)} />
                            

                        </div>
                        <div className="mb-3">
                            <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                            <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" 
                              value={email}
                              required
                              onChange={(e)=>setEmail(e.target.value)}/>
                            <p className='fw-bold text-danger'>{email1}</p>
                        </div>
                        <div className="mb-3">
                            <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                            <input type="password" className="form-control" id="exampleInputPassword1" 
                              value={pass}
                              required
                              onChange={(e)=>setPass(e.target.value)}/><p className='fw-bold text-danger'>{pass1}</p>
                              <p className='fw-bold text-danger'>{pass2}</p>
                        </div>
                        <div className="mb-3">
                            <label htmlFor="exampleInputPassword1" className="form-label"> Confirm Password</label>
                            <input type="password" className="form-control" id="exampleInputPassword1" 
                              value={conpass}
                              required
                              onChange={(e)=>setConpass(e.target.value)}/>
                              <p className='fw-bold text-danger'>{pass1}</p>
                        </div>

                        <button type="button" className="btn btn-success">REGISTER</button>
                        <p className='text-center'>OR</p>
                        <button type="button"  className="btn btn-success">LOGIN</button>
                   
                    

                    </form>
                </div>
            </div>
        </div>
    );
}

export default Signup;
